import Swup from 'swup';
import type { Plugin as PluginType } from 'swup';
export type { PluginType };
export default class Plugin implements Omit<PluginType, 'name'> {
    isSwupPlugin: true;
    requires: {};
    swup: Swup;
    version: string | undefined;
    mount(): void;
    unmount(): void;
    _beforeMount(): void;
    _afterUnmount(): void;
    _checkRequirements(): boolean;
}
